(403, 2, '_elementor_data', '[{\"id\":\"37cb962\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"84a7429\",\"elType\":\"column\",\"settings\":{\"_column_size\":100,\"_inline_size\":null},\"elements\":[{\"id\":\"aa7b380\",\"elType\":\"section\",\"settings\":{\"structure\":\"20\"},\"elements\":[{\"id\":\"2d7adb5\",\"elType\":\"column\",\"settings\":{\"_column_size\":50,\"_inline_size\":42.648},\"elements\":[{\"id\":\"196fe21\",\"elType\":\"widget\",\"settings\":[],\"elements\":[],\"widgetType\":\"spacer\"},{\"id\":\"4067d95\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<h4 style=\\\"text-align: center;\\\"><span style=\\\"color: #202122; font-family: sans-serif; font-size: 14px;\\\">Una tienda<\\/span><span style=\\\"color: #202122; font-family: sans-serif; font-size: 14px;\\\"> o negocio <\\/span><span style=\\\"color: #202122; font-family: sans-serif;\\\"><span style=\\\"font-size: 14px;\\\">es un tipo de establecimiento comercial, f<\\/span><\\/span><span style=\\\"color: #202122; font-family: sans-serif; font-size: 14px;\\\">\\u00edsico o virtual<\\/span><span style=\\\"color: #202122; font-family: sans-serif; font-size: 14px;\\\"> donde el comprador puede adquirir tanto bienes <\\/span><span style=\\\"color: #202122; font-family: sans-serif; font-size: 14px;\\\">como servicios<\\/span><span style=\\\"color: #202122; font-family: sans-serif; font-size: 14px;\\\">\\u00a0a cambio de dinero.<\\/span><\\/h4>\"},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":true},{\"id\":\"36039f9\",\"elType\":\"column\",\"settings\":{\"_column_size\":50,\"_inline_size\":57.352},\"elements\":[{\"id\":\"0213448\",\"elType\":\"widget\",\"settings\":{\"image\":{\"url\":\"http:\\/\\/localhost\\/tiendita\\/wp-content\\/uploads\\/2022\\/04\\/desarrollo-tiendas-online.jpg\",\"id\":113,\"alt\":\"\",\"source\":\"library\"}},\"elements\":[],\"widgetType\":\"image\"}],\"isInner\":true}],\"isInner\":true},{\"id\":\"24c1752\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<h5 style=\\\"text-align: left;\\\"><span style=\\\"color: #202122; font-family: sans-serif; font-size: 14px;\\\">La palabra tienda<\\/span><span style=\\\"color: #202122; font-family: sans-serif; font-size: 14px;\\\">\\u00a0implica un establecimiento peque\\u00f1o con atenci\\u00f3n directa por parte de un vendedor o dependiente;<\\/span><span style=\\\"color: #202122; font-family: sans-serif; font-size: 14px;\\\"> tambi\\u00e9n presupone la existencia de un mostrador <\\/span><span style=\\\"color: #202122; font-family: sans-serif; font-size: 14px;\\\">\\u00a0mesa que separa la sala de ventas de los art\\u00edculos en venta. Esta forma de comercio es opuesta al comercio en r\\u00e9gimen de libre servicio<\\/span><span style=\\\"color: #202122; font-family: sans-serif; font-size: 14px;\\\"> donde el consumidor se acerca a los art\\u00edculos, los elige y los lleva hasta la l\\u00ednea de cajas registradoras<\\/span><span style=\\\"color: #202122; font-family: sans-serif; font-size: 14px;\\\">\\u00a0para pagar su compra.<\\/span><\\/h5>\"},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"30eb9dd\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"10a1703\",\"elType\":\"column\",\"settings\":{\"_column_size\":100,\"_inline_size\":null},\"elements\":[],\"isInner\":false}],\"isInner\":false}]'),
