(8, 1, '2022-04-11 02:21:49', '2022-04-11 02:21:49', '<style>/*! elementor - v3.6.2 - 04-04-2022 */\n.elementor-widget-image{text-align:center}.elementor-widget-image a{display:inline-block}.elementor-widget-image a img[src$=\".svg\"]{width:48px}.elementor-widget-image img{vertical-align:middle;display:inline-block}</style>												<img width=\"826\" height=\"600\" src=\"http://localhost/tiendita/wp-content/uploads/2022/04/20190415_1_certificacion-BRC-certificacion-IFS.jpg\" alt=\"\" loading=\"lazy\" />															\n		<!-- wp:shortcode -->\n[woocommerce_cart]\n<!-- /wp:shortcode -->', 'Carrito', '', 'publish', 'closed', 'closed', '', 'carrito', '', '', '2022-04-27 15:20:40', '2022-04-27 15:20:40', '', 0, 'http://localhost/tiendita/index.php/carrito/', 0, 'page', '', 0),
