(77, 1, '2022-04-11 19:33:56', '2022-04-11 19:33:56', '<style>/*! elementor - v3.6.2 - 04-04-2022 */\n.elementor-heading-title{padding:0;margin:0;line-height:1}.elementor-widget-heading .elementor-heading-title[class*=elementor-size-]>a{color:inherit;font-size:inherit;line-height:inherit}.elementor-widget-heading .elementor-heading-title.elementor-size-small{font-size:15px}.elementor-widget-heading .elementor-heading-title.elementor-size-medium{font-size:19px}.elementor-widget-heading .elementor-heading-title.elementor-size-large{font-size:29px}.elementor-widget-heading .elementor-heading-title.elementor-size-xl{font-size:39px}.elementor-widget-heading .elementor-heading-title.elementor-size-xxl{font-size:59px}</style><h2>UN PEDACITO DE CIELO, UN PEDACITO DE HOGAR Y NUESTROS DULCES A TU CORAZÓN VAN A LLEGAR...</h2>		\n			<style>/*! elementor - v3.6.2 - 04-04-2022 */\n.elementor-widget-image-carousel .swiper-container{position:static}.elementor-widget-image-carousel .swiper-container .swiper-slide figure{line-height:inherit}.elementor-widget-image-carousel .swiper-slide{text-align:center}.elementor-image-carousel-wrapper:not(.swiper-container-initialized) .swiper-slide{max-width:calc(100% / var(--e-image-carousel-slides-to-show, 3))}</style>		\n								<figure><img data-src=\"http://localhost/tiendita/wp-content/uploads/2022/04/maxresdefault-2.jpg\" alt=\"maxresdefault\" /></figure><figure><img data-src=\"http://localhost/tiendita/wp-content/uploads/2022/04/0.jpg\" alt=\"0\" /></figure><figure><img data-src=\"http://localhost/tiendita/wp-content/uploads/2022/04/payaso.jpg\" alt=\"payaso\" /></figure><figure><img data-src=\"http://localhost/tiendita/wp-content/uploads/2022/04/Lucas-Muecas-Mexico.jpg\" alt=\"Lucas-Muecas-Mexico\" /></figure><figure><img data-src=\"http://localhost/tiendita/wp-content/uploads/2022/04/maxresdefault-1-2.jpg\" alt=\"maxresdefault (1)\" /></figure><figure><img data-src=\"http://localhost/tiendita/wp-content/uploads/2022/04/5b4e9d27afc09dc55e8efdc1f1611cfb.jpg\" alt=\"5b4e9d27afc09dc55e8efdc1f1611cfb\" /></figure>			\n			<h2>Tienda</h2>		\n		<p style=\"text-align: center;\">Una tienda o negocio es un tipo de establecimiento comercial, físico o virtual, donde el comprador puede adquirir tanto bienes como servicios a cambio de dinero.</p><p>Las tiendas pueden dedicarse a vender un producto determinado tales como ropa, comida o electrónica, o ampliar su surtido a diversos tipos de artículos. Además de las tiendas independientes que funcionan por sí mismas, existen las galerías comerciales y lugares conocidos como centros comerciales donde varias tiendas (locales comerciales) comparten un recinto cerrado.</p>		\n			<style>/*! elementor - v3.6.2 - 04-04-2022 */\n.e-container.e-container--row .elementor-spacer-inner{width:var(--spacer-size)}.e-container.e-container--column .elementor-spacer-inner,.elementor-column .elementor-spacer-inner{height:var(--spacer-size)}</style>		\n			<style>/*! elementor - v3.6.2 - 04-04-2022 */\n.elementor-widget-image{text-align:center}.elementor-widget-image a{display:inline-block}.elementor-widget-image a img[src$=\".svg\"]{width:48px}.elementor-widget-image img{vertical-align:middle;display:inline-block}</style>												<img src=\"http://localhost/tiendita/wp-content/uploads/2022/04/empresa-diseño-tienda-online-1.jpg\" title=\"empresa-diseño-tienda-online\" alt=\"empresa-diseño-tienda-online\" />															\n			<h2>Algunos de nuestros productos</h2>		\n															<img width=\"296\" height=\"170\" src=\"http://localhost/tiendita/wp-content/uploads/2022/04/descarga-1.jpg\" alt=\"\" loading=\"lazy\" />															\n															<img width=\"600\" height=\"750\" src=\"http://localhost/tiendita/wp-content/uploads/2022/04/pinata-spiderman-colgado.jpg\" alt=\"\" loading=\"lazy\" />															\n															<img width=\"840\" height=\"473\" src=\"http://localhost/tiendita/wp-content/uploads/2022/04/EAVhl2_W4AAVX-G.jpg\" alt=\"\" loading=\"lazy\" />															\n															<img width=\"500\" height=\"295\" src=\"http://localhost/tiendita/wp-content/uploads/2022/04/D_NQ_NP_687914-MLM31238375603_062019-O.jpeg\" alt=\"\" loading=\"lazy\" />															\n															<img width=\"840\" height=\"473\" src=\"http://localhost/tiendita/wp-content/uploads/2022/04/maxresdefault-1-1.jpg\" alt=\"\" loading=\"lazy\" />															\n															<img width=\"500\" height=\"368\" src=\"http://localhost/tiendita/wp-content/uploads/2022/04/41p49PRf81L._SL500_.jpg\" alt=\"\" loading=\"lazy\" />															\n															<img width=\"750\" height=\"500\" src=\"http://localhost/tiendita/wp-content/uploads/2022/04/Pan-Blanco-Mediano-1.png\" alt=\"\" loading=\"lazy\" />															\n															<img width=\"300\" height=\"300\" src=\"http://localhost/tiendita/wp-content/uploads/2022/04/WhatsApp-Image-2022-04-19-at-3.06.14-PM-2.jpeg\" alt=\"\" loading=\"lazy\" />															\n															<img width=\"536\" height=\"787\" src=\"http://localhost/tiendita/wp-content/uploads/2022/04/A1-Xy2-CAAA7esq.jpg\" alt=\"\" loading=\"lazy\" />															\n			<h2>Para más información sobre nuestros productos.</h2>		\n			<a href=\"http://localhost/tiendita/index.php/contacto/\" role=\"button\">\n						CONTÁCTENOS\n					</a>', 'Inicio', '', 'publish', 'closed', 'closed', '', 'inicio', '', '', '2022-04-28 21:45:56', '2022-04-28 21:45:56', '', 0, 'http://localhost/tiendita/?page_id=77', 0, 'page', '', 0),
