(118, 1, '2022-04-12 01:20:20', '2022-04-12 01:20:20', '<style>/*! elementor - v3.6.2 - 04-04-2022 */\n.e-container.e-container--row .elementor-spacer-inner{width:var(--spacer-size)}.e-container.e-container--column .elementor-spacer-inner,.elementor-column .elementor-spacer-inner{height:var(--spacer-size)}</style>		\n		<h4 style=\"text-align: center;\">Una tienda o negocio es un tipo de establecimiento comercial, físico o virtual donde el comprador puede adquirir tanto bienes como servicios a cambio de dinero.</h4>		\n			<style>/*! elementor - v3.6.2 - 04-04-2022 */\n.elementor-widget-image{text-align:center}.elementor-widget-image a{display:inline-block}.elementor-widget-image a img[src$=\".svg\"]{width:48px}.elementor-widget-image img{vertical-align:middle;display:inline-block}</style>												<img width=\"800\" height=\"492\" src=\"http://localhost/tiendita/wp-content/uploads/2022/04/desarrollo-tiendas-online.jpg\" alt=\"\" loading=\"lazy\" />															\n		<h5 style=\"text-align: left;\">La palabra tienda implica un establecimiento pequeño con atención directa por parte de un vendedor o dependiente; también presupone la existencia de un mostrador  mesa que separa la sala de ventas de los artículos en venta. Esta forma de comercio es opuesta al comercio en régimen de libre servicio donde el consumidor se acerca a los artículos, los elige y los lleva hasta la línea de cajas registradoras para pagar su compra.</h5>', 'Acerca de', '', 'inherit', 'closed', 'closed', '', '2-revision-v1', '', '', '2022-04-12 01:20:20', '2022-04-12 01:20:20', '', 2, 'http://localhost/tiendita/?p=118', 0, 'revision', '', 0),
(120, 1, '2022-04-26 18:16:46', '2022-04-26 18:16:46', '<style>/*! elementor - v3.6.2 - 04-04-2022 */\n.elementor-heading-title{padding:0;margin:0;line-height:1}.elementor-widget-heading .elementor-heading-title[class*=elementor-size-]>a{color:inherit;font-size:inherit;line-height:inherit}.elementor-widget-heading .elementor-heading-title.elementor-size-small{font-size:15px}.elementor-widget-heading .elementor-heading-title.elementor-size-medium{font-size:19px}.elementor-widget-heading .elementor-heading-title.elementor-size-large{font-size:29px}.elementor-widget-heading .elementor-heading-title.elementor-size-xl{font-size:39px}.elementor-widget-heading .elementor-heading-title.elementor-size-xxl{font-size:59px}</style><h6>Más información</h6>		\n		<p>Francisco I. Madero #258.          Cunduacán, Tabasco, México.</p><h5>Horarios.                         </h5><p>Lunes a Sábado de 8:00 a.m. a 7:00 p.m.                                          Domingos de 9:00 a.m. a 5:00 p.m.</p>		\n			<h2>Acerca de nosotros</h2>		\n		<p style=\"text-align: center;\">Ven y disfruta de nuestros productos que tenemos disponibles, contamos con diferentes piñatas para sus eventos especiales.</p>		\n					<form role=\"search\" action=\"http://localhost/tiendita\" method=\"get\">\n									<input placeholder=\"Escribe y presiona Enter...\" type=\"search\" name=\"s\" title=\"Buscar\" value=\"\">\n					<button id=\"clear-with-button\" type=\"reset\">\n					</button>\n					<button type=\"submit\">\n					</button>\n				</form>\n			<style>/*! elementor - v3.6.2 - 04-04-2022 */\n.e-container.e-container--row .elementor-spacer-inner{width:var(--spacer-size)}.e-container.e-container--column .elementor-spacer-inner,.elementor-column .elementor-spacer-inner{height:var(--spacer-size)}</style>		\n			<h2>Redes sociales</h2>		\n			<a href=\"https://www.facebook.com/latienditadela.esquinaec\" role=\"button\">\n						Haz clic aquí\n					</a>\n			<a href=\"#\" role=\"button\">\n						Haz clic aquí\n					</a>